import React, {Component} from 'react';
import ImgProfile from '../images/confidence.jpg'
import {HashLink as Link} from "react-router-hash-link";

class Profile extends Component {
    render() {
        return (
            <div>
                <div className='card'>
                    <div className='card-image'>
                        <img className='activator' src={ImgProfile} alt='Confidence Mukwindidza'/>
                        <Link className='btn-floating halfway-fab waves-effect waves-light red'>
                            <i className='material-icons activator'>m</i>
                        </Link>
                    </div>
                </div>
            </div>
        );
    }
}

export default Profile;
